import React from "react";
import logo from "../../images/logo_2";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        ProofIT
      </a>
    </nav>
  );
}



export function Nav() {
  return (
    <nav className="topnav">
      <a href=""><img src={logo} alt="logo"/></a>
      <a href="">Sign IN</a>
    </nav>
  )
}
export default Nav;
